import React from 'react'
import { SvgComponentProps } from '.'

export const Lettuce = ({
  sizemap,
  ...props
}: SvgComponentProps): React.ReactElement => {
  return (
    <svg
      {...props}
      fill='none'
      height={`${sizemap}px`}
      viewBox='0 0 135 134'
      width={`${sizemap}px`}
      xmlns='http://www.w3.org/2000/svg'
      xmlnsXlink='http://www.w3.org/1999/xlink'
    >
      <path
        d='M134.5 134h134v134h-134z'
        fill='url(#a)'
        transform='rotate(180 134.5 134)'
      />
      <defs>
        <pattern
          height={1}
          id='a'
          patternContentUnits='objectBoundingBox'
          width={1}
        >
          <use transform='translate(-.25) scale(.00245)' xlinkHref='#b'/>
        </pattern>
        <image
          height='408'
          id='b'
          width='612'
          xlinkHref='data:image/png;base64,'
        />
      </defs>
    </svg>
  )
}